import {View, Text} from "react-native";

const App = () =>{
  return (
    <View style={styles.container}>
      <Text style={{color:"yellow",fontSize:25}}>Hello React Native!</Text>
    </View>
  )
};


const styles= StyleSheet.create({
  container:{
    backgroundColor:"gray",
    flex:1,
    justifyContent:"center",
    alignItems:"center"
  },

})

export default App;
